static int char2int(char a, int base)
{
	int i;
	if ((a>='A') && (a<='Z')) {
		i=a-'A'+10;
	} else if ((a>='a') && (a<='z')) {
		i=a-'a'+10;
	} else if ((a>='0') && (a<='9')) {
		i=a-'0';
	} else return -1;
	if (i>=base) return -1;
	return i;
}

static int parse_integer(struct eval_scalar *i, char *num, int base, int lenmod)
{
	uint64 k = 0;
	int l = strlen(num)+lenmod;
	while (l--) {
		int c = char2int(*num, base);
		if (c==-1) return 0;
		k *= base;
		k += c;
		num++;
	}
	i->type = SCALAR_INT;
	i->scalar.integer.value = k;
	i->scalar.integer.type = TYPE_UNKNOWN;
	return 1;
}

static int parse_gpr(struct eval_scalar *i, char *s)
{
	int r = 0;
	if (tolower(*s) != 'r') return 0;
	s++;
	do {
		int c = char2int(*s, 10);
		if (c == -1) return 0;
		r *= 10;
		r += c;
		s++;
	} while (*s);
	if (r>31) return 0;
	i->type = SCALAR_REG;
	i->scalar.reg.type = REG_GPR;
	i->scalar.reg.num = r;
	return 1;
}

static int parse_fpr(struct eval_scalar *i, char *s)
{
	int r = 0;
	if (tolower(*s) != 'f') return 0;
	s++;
	if (tolower(*s) != 'r') return 0;
	s++;
	do {
		int c = char2int(*s, 10);
		if (c == -1) return 0;
		r *= 10;
		r += c;
		s++;
	} while (*s);
	if (r>31) return 0;
	i->type = SCALAR_REG;
	i->scalar.reg.type = REG_FPR;
	i->scalar.reg.num = r;
	return 1;
}

