static int parse_pstring(struct eval_scalar *s, char *cstr, int len)
{
	int alloclen = len;
	if (!len) alloclen = 1;
	
	s->type = SCALAR_STR;
	s->scalar.str.value = (char*)malloc(alloclen);
	memmove(s->scalar.str.value, cstr, len);
	s->scalar.str.len = len;
	return 1;
}

